script: |
  super -f text -I q9130.spq | sort > q9130.out

inputs:
  - name: q9130.spq
    data: |
      SELECT DISTINCT + 2 * 48 + cor1.col2 + + ( cor0.col0 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q9130.out
    data: |
      125
      126
      137
      186
      187
      198
      202
      203
      214
